import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from '../api/axiosInstance';
import '../App.css';
import BackToDashboard from '../pages/BackToDashboard';
import { toast } from 'react-toastify';

interface MezzoBean {
  mezzoId: number;
  modello: string;
  targa: string;
  marca: string;
  colore: string;
  annoImmatricolazione: number;
  prezzo: number;
}

interface Moto {
    motoId: number;
    consumoMedio: number;
    cilindrata: string;
    motoreEuro?: string;
    alimentazione?: string;
    tipoMoto?: string;
    raffreddamento?: string;
    tipoMotore: string;
    potenzaKw: string;
    peso: string;
    mezzoBean?: MezzoBean;
  }  

const MotoEdit: React.FC = () => {
  const { motoId } = useParams<{ motoId: string }>();
  const navigate = useNavigate();
 const [moto, setMoto] = useState<Moto | null>(null);
    const [alimentazioni, setAlimentazioni] = useState<any[]>([]);
    const [motori, setMotori] = useState<any[]>([]);
    const [tipoMoto, setTipoMoto] = useState<any[]>([]);
    const [tipoMotore, setTipoMotore] = useState<any[]>([]);
  const [error, setError] = useState('');

    useEffect(() => {
        axios.get('/automezzi/findAllTipoAlimentazione')
          .then(res => setAlimentazioni(res.data.tipoAlimentazioneBeanList || []));
    
        axios.get('/automezzi/findAllMotoreEuro')
          .then(res => setMotori(res.data.motoreEuroBeanList || []));
    
        axios.get('/automezzi/findAllTipoMoto')
          .then(res => setTipoMoto(res.data.tipoMotoBeanList || []));
    
        axios.get('/automezzi/findAllTipoMotore')
          .then(res => setTipoMotore(res.data.tipoMotoreBeanList || []));
      }, [motoId]);
    
      const handleChange = (field: string, value: any) => {
        setMoto(prev => prev ? { ...prev, [field]: value } : prev);
      };
    
      const handleMezzoChange = (field: string, value: any) => {
        setMoto(prev => prev && prev.mezzoBean ? {
          ...prev,
          mezzoBean: { ...prev.mezzoBean, [field]: value }
        } : prev);
      };
    
      const handleSubmit = (e: React.FormEvent) => {
        e.preventDefault();
        setError('');
    
        axios.post('/automezzi/updateMoto', {
          motoBean: moto,
          mezzoBean: moto?.mezzoBean
        })
          .then(res => {
            if (res.data.errorCode === 0) {
                toast('✅ Modificato con successo');
              navigate('/');
            } else {
              setError(res.data.errorMessage);
            }
          })
          .catch(() => setError('Errore durante la richiesta'));
      };
    
  if (!moto) return <p>Caricamento...</p>;

  return (
    <div className="detail-container">
    <BackToDashboard />
    <h2>Modifica Moto</h2>
    <form className="form-container">
      <div className="form-group">
        <label>Marca:</label>
        <input type="text" value={moto.mezzoBean?.marca || ''} readOnly />
      </div>
      <div className="form-group">
        <label>Modello:</label>
        <input type="text" value={moto.mezzoBean?.modello || ''} readOnly />
      </div>
      <div className="form-group">
        <label>Targa:</label>
        <input type="text" value={moto.mezzoBean?.targa || ''} readOnly />
      </div>
      <div className="form-group">
        <label>Colore:</label>
        <input type="text" value={moto.mezzoBean?.colore || ''} readOnly />
      </div>
      <div className="form-group">
        <label>Anno Immatricolazione:</label>
        <input type="number" value={moto.mezzoBean?.annoImmatricolazione || 0} readOnly />
      </div>
      <div className="form-group">
        <label>Prezzo (€):</label>
        <input type="number" value={moto.mezzoBean?.prezzo || 0} readOnly />
      </div>
  
      <div className="form-group">
        <label>Potenza (kW):</label>
        <input type="text" value={moto.potenzaKw} readOnly />
      </div>
      <div className="form-group">
        <label>Peso (kg):</label>
        <input type="text" value={moto.peso} readOnly />
      </div>
      <div className="form-group">
        <label>Cilindrata:</label>
        <input type="text" value={moto.cilindrata} readOnly />
      </div>
      <div className="form-group">
        <label>Raffreddamento:</label>
        <input type="text" value={moto.raffreddamento} readOnly />
      </div>
      <div className="form-group">
        <label>Tipo Motore:</label>
        <input type="text" value={moto.tipoMotore} readOnly />
      </div>
      <div className="form-group">
        <label>Motore Euro:</label>
        <input type="text" value={moto.motoreEuro || ''} readOnly />
      </div>
      <div className="form-group">
        <label>Alimentazione:</label>
        <input type="text" value={moto.alimentazione || ''} readOnly />
      </div>
      <div className="form-group">
        <label>Tipo Moto:</label>
        <input type="text" value={moto.tipoMoto || ''} readOnly />
      </div>
    </form>
  </div>
  
  );
};

export default MotoEdit;
